import React from "react";

const Contact = (props) => {
  const { images, Title } = props.contact;

  return (
    <div>
         <div className="col-md-4 col-lg-4 col-sm-12 col-12">
            <div className="py-5 contactme-card text-dark text-center  animate__animated animate__fadeInLeft"></div>
      <div className="py-5 contactme-card text-dark text-center  animate__animated animate__fadeInLeft">
        <div className="icon-color">
          <i className={images}></i>
        </div>
        <div className="fw-bold p-3 text-justify">{Title}</div>
      </div>
    </div>

    { Title }
    </div>

  );
};

export default Contact;
